def ingestSectionOwnersinDB(thor_id,section_owner_email,assigned_section_list,section_owner_role):
    try:
        for section in assigned_section_list:
            sectionName=section.get("sectionName")
            if sectionName:
                DCXDBOperations.update_section_owners(thor_id=thor_id,section_owner_email=section_owner_email,section_name=sectionName,section_owner_role=section_owner_role)
        return {"response":"section_owner_assigned" }
    except Exception as e:
        print("Exception occured in  ingesting Section with their owners",e)
        pass

def assignSectionOwner():
    try:
        data = request.get_json()
        thor_id = data.get("thor_id")
        section_owner_email = data.get("section_owner_email")
        assigned_sections_list = data.get('assigned_sections')
        section_owner_role = data.get("role")
        response = ingestSectionOwnersinDB(thor_id=thor_id, section_owner_email=section_owner_email,
                                           assigned_section_list=assigned_sections_list,section_owner_role=section_owner_role)

        return Response(response=json.dumps(response), status=200, mimetype="application/json")
    except Exception as e:
        return Response(response="Something Went Wrong", status=500, mimetype="application/json")

